import React from "react";
import "../css/landing.css";
import hero from "../images/hero.jpg";

function Landing() {
  return (
    <div className="landingHero">
      <div className="landingHeroLeft"></div>
      <img src={hero}></img>
    </div>
  );
}

export default Landing;
